import Task from "./Task";
import { DragDropContext, Droppable, Draggable } from "react-beautiful-dnd";
import './TaskList.css';

const TaskList = ({ data, title }) => {
    return (
        <div className="task-list">
            <h2 id="title">{ title }</h2>\
            <DragDropContext>
                <Droppable droppableId="tasks">
                    <ul>
                        {data.map(note, index => (
                            <Draggable key={note.id} draggableId={note.id} index={index}>
                                {(provided) => (
                                    <li {...provided.dragHandleProps} {...provided.dragHandleProps} ref={provided.innerRef}></li>
                                )}
                                <div className="note">
                                    <Task title={ note.title } body={ note.body } author={ note.author } />
                                </div>
                            </Draggable>
                        ))}
                    </ul>
                </Droppable>
            </DragDropContext>
        </div>
    );
}
 
export default TaskList;
